def test_get_urlimage_size():
    url = 'https://img0.baidu.com/it/u=716241417,191815701&fm=253&fmt=auto&app=138&f=PNG?w=500&h=501'
    height, width = abava.get_urlimage_size(url)
    return height, width


def test_draw_rectangle():
    url = 'https://img0.baidu.com/it/u=716241417,191815701&fm=253&fmt=auto&app=138&f=PNG?w=500&h=501'
    img = abava.read_url_image(url)
    abava.draw_rectangle((50, 50, 100, 100), img, [255, 0, 0], 'test')
    cv2.imwrite('../example_files/images/molar_rectangle.png', img)


def test_draw_point():
    url = 'https://img0.baidu.com/it/u=716241417,191815701&fm=253&fmt=auto&app=138&f=PNG?w=500&h=501'
    img = abava.read_url_image(url)
    abava.draw_point(img, 'test', 50, 50, [255, 0, 0])
    cv2.imwrite('../example_files/images/molar_point.png', img)


